import "./Token/CAToken.sol";

contract CCT is CAToken{

    // CDC contract address
    address public _CDC; 
    // PCC contract address
    address public _PCC;

    //initialize the token contract 
    //include the token name,token symbol and owner
    //and the addresses of CDC and PCC
