    public initializer forceInitializeFromProxy {
        initBlackList();
        __ERC20_init(name, symbol);
        _transferOwnership(initOwner);
        _CDC = _cdc;
        _PCC = _pcc;
    }

    modifier onlyAuthed(){
        require(msg.sender == contractOwner() || msg.sender == _CDC || msg.sender == _PCC,"issue CCT must be authorized");
